import React from 'react';
import './style.css';

export default class TxtOut extends React.Component {

	static defaultProps = {
		label: "",
	}

	constructor(props) {
  		super(props);
	}

	render() {
		const label = <p>{this.props.label + ": "}</p>;
		const text  = <p>{this.props.msg}</p>;

		return (
			<div className="box">
				{ label } { msg }
			</div>
		);
	}
}
